typeql:
match $m isa movie, has votes $v, has title $t;
sort $v desc;
limit 5;
fetch { "title": $t, "votes": $v };

match $p isa person, has born $b, has name $n; $b > 1960;
limit 3;
fetch { "name": $n, "born": $b };

match
  $p isa person, has name $n;
  $r (reviewer: $p, film: $m) isa reviewed, has rating $rating;
  $m isa movie, has title $t;
  $rating > 90;
fetch { "reviewer": $n, "movie": $t, "rating": $rating };

match
  $p isa person, has born $b;
  (director: $p, film: $m) isa directed;
  $m isa movie, has title $t;
  $b < 1950;
sort $t asc;
limit 5;
fetch { "title": $t };

match
  $p isa person, has name "Keanu Reeves";
  $r (actor: $p, film: $m) isa acted_in, has roles $roles;
  $m isa movie, has title $t;
fetch { "movie": $t, "roles": $roles };

match
  $p isa person, has born 1952;
  (producer: $p, film: $m) isa produced;
  $m isa movie, has title $t;
limit 3;
fetch { "title": $t };

match
  $p isa person, has name $n;
  (actor: $p, film: $m) isa acted_in;
  $m isa movie, has tagline "Welcome to the Real World";
fetch { "name": $n };

match
  $m isa movie, has title $t;
  $r (reviewer: $p, film: $m) isa reviewed, has summary "Dark, but compelling", has rating $rating;
sort $rating desc;
limit 5;
fetch { "title": $t, "rating": $rating };

match $m isa movie, has title $t, has votes $v;
sort $v asc;
limit 3;
fetch { "title": $t, "votes": $v };

match
  $keanu isa person, has name "Keanu Reeves";
  $p isa person, has name $n;
  (follower: $p, followed: $keanu) isa follows;
limit 3;
fetch { "name": $n };

match
  $p isa person, has name $n;
  (producer: $p, film: $m1) isa produced;
  (actor: $p, film: $m2) isa acted_in;
fetch { "name": $n };

match $m isa movie, has title $t, has released $r;
sort $r desc;
limit 5;
fetch { "title": $t, "released": $r };

match $m isa movie, has title $t, has released $r;
$r >= 1990; $r < 2000;
fetch { "title": $t, "released": $r };

match
  $p isa person, has name $n;
  (writer: $p, film: $m) isa wrote;
  $m isa movie, has title "The Matrix";
fetch { "name": $n };

match $p isa person, has born 1964, has name $n;
limit 3;
fetch { "name": $n };

match
  $m isa movie, has title $t;
  $r (reviewer: $p, film: $m) isa reviewed, has rating $rating, has summary $s;
  $rating < 50;
fetch { "title": $t, "rating": $rating, "summary": $s };
